document.querySelector('body').addEventListener('wheel', (e) => slide(e))

if (window.screen.width > 779) {
  oldSecond = seconds
  $('body').on("wheel", () => {
    if (!inApps && oldSecond + 1 < seconds) {
      direction ? slideUp() : slideDown()
      oldSecond = 0
      seconds = 0
    }
    inApps = false
  })
}

function slide(e) {
  e = e || window.event

  direction = (e.deltaY || e.detail || e.wheelDelta) < 0
}

function slideUp() {
  switch (thisPage) {
    case 2:
      hidePage2(true)
      break
    case 3:
      hidePage3(true)
      break
    case 5:
      hidePage5(true)
      break
    case 6:
      hidePage6(true)
      break
  }
  setTimeout(() => {
    if (thisPage !== 1) {
      if (thisPage === 5) {
        thisPage -= 2
      } else {
        thisPage -= 1
      }

      hidePages()
      $('.nav__tab_active').removeClass('nav__tab_active')
      showPage(thisPage, true)
    }
  }, 2000)
}

function slideDown() {
  switch (thisPage) {
    case 1:
      hidePage1()
      break
    case 2:
      hidePage2()
      break
    case 3:
      hidePage3()
      break
    case 5:
      hidePage5()
      break
  }
  setTimeout(() => {
    if (thisPage !== 6) {
      // ###
      if (thisPage === 3) {
        thisPage += 2
      } else {
        thisPage += 1
      }
      // ###
      /*
      thisPage += 1
      */
      if (thisPage === 8) {
        thisPage = 6
      }
      hidePages()
      $('.nav__tab_active').removeClass('nav__tab_active')
      showPage(thisPage)
    }
  }, 2000)
}

function validate() {
  let userData = document.forms["form-contacts"]["name"].value
  let email = document.forms["form-contacts"]["mail"].value
  let comment = document.forms["form-contacts"]["comment"].value
  let re = /\S+@\S+\.\S+/
  if (userData && re.test(email)) {
    return true
  }
  $('.contacts__inner').html("<button type='submit' class='contacts__button'>Contact us</button> <lottie-player background='transparent'  speed='1' autoplay loop class='contacts__button_background'></lottie-player>")
  userData ? null : $('.contacts__inner').prepend('<p class=\'error\'>*Введите имя')

  re.test(email) ? null : $('.contacts__inner').prepend('<p class=\'error\'>*Введите настоящий e-mail')
  return false
}

