function showPage(id, down = false) {
  $('lottie-player').each((index) => {
    $('lottie-player')[index].style.display = 'none'
  })
  $('body').css('overflow', 'visible')
  $('footer').css('position', 'static')
  $('.about-us__triggers').css('margin-bottom', '0')
  if (id === 3) {
	  $('.our-products__animation').trigger('play');
  }
  hidePages()
  $('#page' + id).show()

  switch (id) {
    case 1:
      animationForPage1(down)
      break
    case 2:
      animationForPage2(down)
      break
    case 3:
      animationForPage3(down)
      break
    case 5:
      animationForPage5(down)
      break
    case 6:
      animationForPage6(down)
      break
    case 7:
      animationForPage7(down)
      break
  }
}

